import {DeleteFoods, Food} from "./ShopSlice";
import "./Food.css";
import {useNavigate, useParams} from "react-router-dom";
import {useEffect} from "react";
export default function FoodUI (props:any) {

    let navigate = useNavigate();
    var today = new Date();
    var date = today.getFullYear()+'-'+(today.getMonth()+1)+'-'+today.getDate();
    const food:Food = props.food;
    let age_perm ;
    if (food.age_permisssion == "&"){
        age_perm= "NoLimit"
    }else{
        age_perm=food.age_permisssion
    }
    let currentData = new Date(date);
    let date_ = new Date(food.expire_date);
    if (currentData > date_){
        DeleteFoods(food)
    }
    const btnDetailHandler=()=>{
        console.log('Go to detail');

        navigate(`/shop/food-details/${food._id}`);
    };
    let {Username} = useParams();
    console.log("Food is",food)
    return ((<div className={"MainFood"}>
    <div className={'food_'} onClick={()=>{navigate(`/${Username}/shop/food-details/${food._id}`);}} style={{backgroundColor: `#4aa55e`}}>
    <div onClick={()=>{btnDetailHandler()}}>
        <img src={food.FoodImage} className={"img_food"} onClick={()=>{navigate(`/movie-details/${food._id}`);}}/>
    </div>
    <div className={'food-title'}>
        <h3>
         { food.Food_name}
         </h3>
         <i className="fa fa-heart" style={{fontSize:"24px" , float:"left", marginTop:"33px"}}></i>
    </div>
    <div className={"YearsDiv"}>
        <h5 className={"Year"}>Age : {age_perm}</h5> &nbsp;
    </div>

</div>
</div>))}
